import React, { Component, Img } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch,
  Redirect
} from 'react-router-dom';
import { Card, Badge, Row, Col, Button } from 'antd';
// partials
import Calender from './partials/Calendar';

// css
import './App.css';
import 'antd/dist/antd.css';

class App extends Component {
  state = {
    addEvent: undefined
  }
  tripleCard () {
    let items = [
      'Add Item', 'Delete Item',
      'Misc.'
    ];
    let cards = items.map(
        (item) =>
          <Col span={8}>
          <Button
            type='primary'
            shape='circle'
            onClick={this.addEvent}
            value='large'>
              {item} </Button>
          </Col>
        )
    return cards;
  }
  render() {
    return (
      <div className="App">
        <Row>
          {this.tripleCard()}
        </Row>
        <Calender/>
      </div>
    );
  }
}

export default App;
